import React from "react";

const Biographie = () => {
    function randomYellow() {
        document.querySelector("span").style.color = "rgb(255, 200 60)";
    }
    return (
        <div className="Biographie modules">
            {randomYellow()}
            <p>
                <span className="marquee">
                    <span>Je suis un développeur de qualité qualitatif </span> -
                    <span> J'apprends plus vite que mon ombre </span> -
                    <span> Je suis passionné</span> -
                    <span> Je suis motivé </span>-
                    <span> Je ne pratique pas le krav maga </span> -
                </span>
                <span className="marquee2">
                    <span>Je suis un développeur de qualité qualitatif </span> -
                    <span> J'apprends plus vite que mon ombre </span> -
                    <span> Je suis passionné</span> -
                    <span> Je suis motivé </span>-
                    <span> Je ne pratique pas le krav maga </span> -
                </span>
            </p>
        </div>
    );
};

export default Biographie;
